import styled from 'styled-components';

export const ProfilePicture = styled.img`
    max-width: 300px;
    min-width: 16px; 
    width: 100%;    
    border-radius: 50%;    
    border: 2px solid var(--primary);
    padding: 5px;
    margin: 0 auto;
`;

export const CentralizedContent = styled.div`
    display: flex;
    justifyContent: center;
    flexDirection: column;
    height: 100%;
`;
